import React from 'react';
import './Styles/Menu.css';

const Menu = (props)=>{

    return ( 
        <nav class="navbar navbar-dark bg-dark fixed-top shadow">
            <h1 className="white owner" style="display: block;">Welcome</h1>
            <button type="button" className="btn btn-success home" id="buttons">Bans</button>
            </nav>
    );
}

export default Menu;
